import {View, Text,} from 'react-native';
import styles from './styles';

const InputBox = () =>{
    return (
        <View style={styles.container}>
        <View style={styles.midContainer}></View>
            <Text>hello there</Text>
        </View>
    )
}
export default InputBox;
